import StaffRoleExample from './StaffRoleExample';

export const StaffRoleExampleConfig = {
    settings: {
        layout: {
            config: {}
        }
    },
    routes: [
        {
            path: '/auth/staff-role-example',
            component: StaffRoleExample
        }
    ]
};
